Данное программное обеспечение включает функциональность декомпиляции («Декомпилятор JetBrains»), которая может воссоздавать исходный код из исходного двоичного кода. Лицензиат признает, что двоичный код и исходный код могут защищаться законодательством об авторском праве и товарных знаках. Перед использованием декомпилятора JetBrains лицензиат должен убедиться, что применимое лицензионное соглашение не запрещает декомпиляцию двоичного кода (за исключением случаев, когда применимое законодательство прямо разрешает это лицензиату), или что лицензиат получил разрешение на декомпиляцию двоичного кода от владельца авторских прав.\par
Использование декомпилятора JetBrains полностью является вашим решением. Лицензиар не поощряет и не одобряет использование декомпилятора JetBrains и не несет ответственности за использование декомпилятора JetBrains лицензиатом в нарушение применимого законодательства.\par
